window.bookSummaryJSON = "<p><b>It’s hard to get revenge without getting a rap sheet. </b></p> <p>After Tempest Cassidy walks in on her husband banging her high school nemesis, her whole world gets turned upside down. She goes from being known as the Duchess of Muffins to the town crazy. Her new MO: revenge.</p> <p>Eventually, Tempest grows weary being arrested. Yet, what choice does she have? If she’s not angry, then she’s simply...sad.</p> <p>Just as she decides to get her life back on track, in walks Cage Erickson, the new bouncer at the local strip club. He’s scary-handsome and the polar opposite of her ex. </p> <p>She’s attracted to him, but she’s not looking for a rebound. He’s attracted to her, but he’s not looking for a serious relationship. So, they agree to be friends. But when lines get blurred in the friend zone, will they both get burned? Or will it be a TKO?</p> <p><b><i>Stud Muffin</i></b><b> is a full-length contemporary romantic comedy, that can be be listened to as a stand-alone, and it is book two in the Donner Bakery series, Green Valley world, Penny Reid book universe.</b></p>"; 
